import {
  StyleSheet,
  Text,
  View,
  ImageBackground,
  SafeAreaView,
  Button,
  TouchableOpacity
} from "react-native";
import React from "react";

export default function ProfileScreen() {
  return (
    <View style={styles.container}>
      <ImageBackground
        source={require("../../assets/media/myappbg.png")}
        style={styles.backgroundImage}
      >
        <SafeAreaView style={styles.loginContainer}>
          <Text style={styles.headerText}>Welcome To Gruvii</Text>
          <TouchableOpacity
            style={styles.buttonSign}
            onPress={() => navigate("HomeScreen")}
            underlayColor="#fff"
          >
            <Text style={[styles.buttonsText, { color: "#13799c" }]}>
              Sign Up
            </Text>
          </TouchableOpacity>
          <TouchableOpacity
            style={styles.buttonLog}
            onPress={() => navigate("HomeScreen")}
            underlayColor="#fff"
          >
            <Text style={[styles.buttonsText]}>Log In</Text>
          </TouchableOpacity>
        </SafeAreaView>
      </ImageBackground>
    </View>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    width: "100%",
    backgroundColor: "transparent",
    alignItems: "center",
    justifyContent: "center"
  },
  backgroundImage: {
    height: "100%",
    width: "100%",
    alignItems: "center",
    justifyContent: "center"
  },
  loginContainer: {
    alignItems: "center",
    justifyContent: "center",
    backgroundColor: "rgba(255,255,255,.9)",
    height: "60%",
    width: "75%"
  },
  headerText: {
    fontSize: 25,
    paddingTop: Platform.OS === "ios" ? 20 : 20,
    paddingBottom: 20,
    color: "black"
  },
  buttonLog: {
    backgroundColor: "#13997c",
    width: "60%",
    paddingVertical: 10,
    marginVertical: 10
  },
  buttonSign: {
    backgroundColor: "transparent",
    shadowColor: "#171717",
    shadowOffset: { width: -2, height: 4 },
    shadowOpacity: 0.9,
    shadowRadius: 3,
    color: "#13997c",
    width: "60%",
    paddingVertical: 10,
    marginVertical: 10
  },
  buttonsText: {
    color: "#fff",
    textAlign: "center"
  }
});
